import "./topbar.scss";
import {Person} from "@material-ui";

export default function Topbar() {
  return (
    <div className="topbar">
      <div className="wrapper">
        <p className="gauche">
          <a href="#presentation" className="logo">
            Anthony Bauchet
          </a>
        </p>
        <h1>TESUTO</h1>

        <p className="droite">C'est a droite</p>
      </div>
    </div>
  );
}
